import React from 'react';

const Icon = ({ name, size = 24, className = '', ...props }) => {
  try {
    const SvgIcon = require(`../../assets/icons/${name}.svg`).default;

    return (
      <div className={className} {...props}>
        <SvgIcon 
          width={size} 
          height={size}
          style={{ display: 'block' }}
        />
      </div>
    );
  } catch (error) {
    console.warn(`Icon "${name}" not found in assets/icons/ folder`);
    return null;
  }
};

export default Icon;
